import React from 'react';
import { createStackNavigator } from 'react-navigation-stack';
import { createBottomTabNavigator } from 'react-navigation-tabs';
import {createMaterialBottomTabNavigator} from 'react-navigation-material-bottom-tabs';
import {Platform} from 'react-native'
import { createDrawerNavigator } from 'react-navigation-drawer';
import { createAppContainer} from 'react-navigation';
import {Ionicons, MaterialIcons} from '@expo/vector-icons'
import Login from "../screens/Login";
import Register from "../screens/Register";
import Kategorije from "../screens/Kategorije";
import VjezbeKategorije from "../screens/VjezbeKategorije";
import Video from "../screens/Video";
import  VjezbeFavoriti from "../screens/VjezbeFavoriti";
import FilteriEkran from "../screens/FilteriEkran";
import AuthLoadingScreen from "../screens/authLoadingScreen";



const stackOpcije= {
    headerStyle: {
        backgroundColor: "#FF0000"
    },
    headerTintColor: "white"
}
const BeforeSignIn = createStackNavigator({
    Login:{screen:Login},
    Register:{screen: Register}, 
}, {
    headerMode: "none",
    initialRouteName: "Login"
});
const AfterSignIn = createStackNavigator({
    SveKategorije: {screen: Kategorije,
            navigationOptions: {
            headerTitle: "Danas vježbam... "} },
    JednaKategorija: {screen:VjezbeKategorije},
    Video: {screen:Video} 
 },);

const AppNavigator=createStackNavigator( {
    Auth: {screen: BeforeSignIn},
    App: {screen: AfterSignIn},
    AuthLoadingScreen: AuthLoadingScreen
},
{
   headerMode: "none",
   initialRouteName: "Auth"
 }
);
const FavoritiNavigacija= createStackNavigator(
    {
        Favoriti:VjezbeFavoriti,
        Video: Video
    }
);
const tabEkrani = {
    Kategorije: {
        screen: AppNavigator,
        navigationOptions: {
            tabBarIcon: (tabInfo) => {
                return (
                <Ionicons 
                name="home" 
                size={24}
                color={tabInfo.tintColor}
                />
                    )
            }
        }
    },
    Favoriti: {
        screen: FavoritiNavigacija,
        navigationOptions: {
            tabBarIcon: (tabInfo) => {
                return (
                <MaterialIcons 
                name="favorite" 
                size={24}
                color={tabInfo.tintColor}
                /> 
                    )
            }
        }
    }
}



const VjezbeTabNavigacija = Platform.OS==='android' ? 
createMaterialBottomTabNavigator(tabEkrani,
    {
        activeBackgroundColor: 'white',
        inactiveBackgroundColor: 'black',
        shifting: true,  
    })
: createBottomTabNavigator(tabEkrani,
        {tabBarOptions: {
           activeBackgroundColor: '#FFCB8B',
           inactiveBackgroundColor: '#FE634E',
           labelStyle: {
             fontSize: 15,
           },
           activeTintColor: 'white',
           inactiveTintColor: 'black',
         }
     })
const FilteriStack = createStackNavigator(
    {
        Filteri: FilteriEkran
    },//nesto ne radi
    {
        defaultNavigationOptions: stackOpcije
    }
    
)
const AppNavigacija = createDrawerNavigator(  {
    TabFavoriti:
    { 
        screen: VjezbeTabNavigacija,
        navigationOptions: {
            drawerLabel: "Exercise"
        }
    } ,
    Filteri: 
    {
        screen: FilteriStack,
        navigationOptions: {
            drawerLabel: "Filteri za odabir vježbi"
        }
    }
},
{
    contentOptions: {
        activeTintColor: "#FF0000",
        labelStyle: {
            fontSize: 20,
            fontWeight: 'normal'
        }
    }
}
)
export default createAppContainer(AppNavigacija);
